text:
What is wrong with my npm package? All my icons in the icons folder are setup like this:
```js icons-fundament/icons/Import.js
import * as React from 'react';
const Import = (props) => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    width="1em"
    height="1em"
    fill="none"
    stroke="currentColor"
    strokeLinecap="round"
    strokeLinejoin="round"
    strokeWidth={2}
    viewBox="0 0 24 24"
    {...props}
  >
    <path d="M12 3v12M8 11l4 4 4-4" />
    <path d="M8 5H4a2 2 0 0 0-2 2v10a2 2 0 0 0 2 2h16a2 2 0 0 0 2-2V7a2 2 0 0 0-2-2h-4" />
  </svg>
);
export default Import;
```


And the build files look like this:
```json icons-fundament/tsconfig.json
{
    "compilerOptions": {
        "declaration": true,
        "declarationDir": "build/types",
        "outDir": "build/esm",
        "moduleResolution": "node",
        "esModuleInterop": true,
        "target": "es5",
        "module": "esnext",
        "jsx": "react"
    },
    "include": ["icons/**/*.js"],
    "exclude": ["node_modules"]
}
```

```mjs icons-fundament/esbuild.prod.mjs
import esbuild from "esbuild";

esbuild
    .build({
        entryPoints: ["icons/index.js"],
        bundle: true,
        outfile: "build/esm/index.js",
        minify: true,
        sourcemap: true,
    })
    .catch(() => process.exit(1));
```

