I want to keep my files as .js

That's completely fine! You can keep your files as `.js` and still make this work. Let's fix your build setup to work properly with JavaScript files containing JSX.

### Here's how to fix your package:

1. **Update your esbuild configuration** to properly handle JSX in your JavaScript files:

```javascript
// esbuild.prod.mjs
import esbuild from "esbuild";

esbuild
    .build({
        entryPoints: ["icons/index.js"],
        bundle: true,
        outfile: "build/esm/index.js",
        minify: true,
        sourcemap: true,
        jsx: "automatic", // This enables React JSX transformation for .js files
        jsxDev: false, // Use production React transforms
        format: "esm", // Ensure output is ES modules
        target: ["es2015"], // Target more modern browsers for better compatibility with React
        external: ["react"], // Mark React as external dependency
    })
    .catch(() => process.exit(1));
```

2. **Modify your tsconfig.json** to better handle JavaScript files with JSX:

```json
{
    "compilerOptions": {
        "declaration": true,
        "declarationDir": "build/types",
        "outDir": "build/esm",
        "moduleResolution": "node",
        "esModuleInterop": true,
        "target": "es2015",
        "module": "esnext",
        "jsx": "react-jsx",
        "allowJs": true,
        "checkJs": false,
        "skipLibCheck": true
    },
    "include": ["icons/**/*.js"],
    "exclude": ["node_modules"]
}
```

3. **Make sure your package.json has the correct configuration**:

```json
{
  "name": "icons-fundament",
  "version": "1.0.0",
  "main": "build/esm/index.js",
  "module": "build/esm/index.js",
  "types": "build/types/index.d.ts",
  "files": ["build"],
  "peerDependencies": {
    "react": "^16.8.0 || ^17.0.0 || ^18.0.0"
  },
  "sideEffects": false
}
```

4. **Create a proper build script** in your package.json:

```json
"scripts": {
  "build": "node esbuild.prod.mjs && tsc --emitDeclarationOnly",
  "clean": "rimraf build"
}
```

5. **Add a .babelrc file** to ensure proper JSX handling (optional if esbuild is working):

```json
{
  "presets": [
    ["@babel/preset-env", { "modules": false }],
    ["@babel/preset-react", { "runtime": "automatic" }]
  ]
}
```

### Why this approach works:

1. The updated esbuild config properly handles JSX in your JavaScript files
2. The TypeScript compiler is only used for type definitions, not for transpilation
3. We're keeping all your files as `.js` as requested
4. React is treated as an external dependency, which is the proper way for component libraries

This setup should solve your issues while keeping all your files as JavaScript. After making these changes, run `npm run build` and your package should build correctly.
